
USE swiper;

CREATE TABLE IF NOT EXISTS Students (
    NUID INTEGER,
    FirstName TEXT,
    LastName TEXT,
    Email varchar(99),
    MealPlan INTEGER,
    SwipesLeft INTEGER,
    HuskyDollarBalance INTEGER,
    PRIMARY KEY (NUID)
);


CREATE TABLE IF NOT EXISTS DiningHall (
    HallID INTEGER,
    HallName TEXT,
    OpenClosed BOOLEAN,
    CurrentCapacity INTEGER,
    MaxCapacity INTEGER,
    PRIMARY KEY (HallID)
);



CREATE TABLE IF NOT EXISTS Meals (
    MealID INTEGER,
    MealName TEXT,
    ServedAt INTEGER,
    Description TEXT,
    Votes INTEGER,
    Allergen INTEGER,
    DietaryConstraints INTEGER,
    Macros INTEGER,
    PRIMARY KEY (MealID),
    FOREIGN KEY (ServedAt) REFERENCES DiningHall(HallID),
    FOREIGN KEY (Votes) REFERENCES Votes(VoteID),
    FOREIGN KEY (Allergen) REFERENCES Allergens(AllergenID),
    FOREIGN KEY (DietaryConstraints) REFERENCES DietaryRestrictions(ConstraintID),
    FOREIGN KEY (Macros) REFERENCES Macros(MacroID)
);



CREATE TABLE IF NOT EXISTS Comments (
    CommentID INTEGER,
    CommentText TEXT,
    CommentDate DATE,
    FromStudent INTEGER,
    PRIMARY KEY (CommentID),
    FOREIGN KEY (FromStudent) REFERENCES Students(NUID)
);

CREATE TABLE IF NOT EXISTS Allergens (
    AllergenID INTEGER,
    AllergenType TEXT,
    PRIMARY KEY (AllergenID)
);

CREATE TABLE IF NOT EXISTS Macros (
    MacroID INTEGER,
    MealID INTEGER,
    Fiber INTEGER,
    Carbs INTEGER,
    Fats INTEGER,
    Proteins INTEGER,
    Calories INTEGER,
    PRIMARY KEY (MacroID),
    FOREIGN KEY (MealID) REFERENCES Meals(MealID)
);

CREATE TABLE IF NOT EXISTS DietaryRestrictions (
    ConstraintID Integer,
    MealID Integer,
    None BOOLEAN,
    Halal BOOLEAN,
    Kosher BOOLEAN,
    Vegan BOOLEAN,
    GlutenFree BOOLEAN,
    PRIMARY KEY (ConstraintID),
    FOREIGN KEY (MealID) REFERENCES Meals(MealID)
);

CREATE TABLE IF NOT EXISTS MealSwipeHistory (
    SwipeID INTEGER,
    SwipeStudent INTEGER,
    Time TIME,
    HallID INTEGER,
    Date DATE,
    PRIMARY KEY (SwipeID),
    FOREIGN KEY (HallID) REFERENCES DiningHall(HallID),
    FOREIGN KEY (SwipeStudent) REFERENCES Students(NUID)
);


CREATE TABLE IF NOT EXISTS HuskyDollarTransactions (
    TransactionID INTEGER,
    VendorName Text,
    VendorID INTEGER,
    TransactionStudent INTEGER,
    Time TIME,
    Date DATE,
    PRIMARY KEY (TransactionID),
    FOREIGN KEY (VendorID) REFERENCES Vendors(VendorID),
    FOREIGN KEY (TransactionStudent) REFERENCES Students(NUID)
);


CREATE TABLE IF NOT EXISTS Vendors (
    VendorID INTEGER,
    VendorName TEXT,
    Address VARCHAR(99),
    PRIMARY KEY (VendorID)
);
